import React, { useEffect } from 'react';
import {Link} from 'react-router-dom';
import './Header.css';

const Header = () => {
    var[headerstate,setheaderstate]=useEffect(false);
    return (
        <div>
           <div className='header'>
            <nav className='nav'>
                <h1 className='logo'>Welcome to BlogApp</h1>
                <div className='art' >
                    <Link className='articles'  to="/">Home</Link>
                   
                    <Link className='articles' to="/articlelist" hidden={headerstate}>Articles</Link>
                    <Link className='articles' to="/addarticle">Add Articles</Link>
                    <Link className='articles' to="/signup">SignUp</Link>
                    <Link className='articles' to="/login">Login</Link>
                </div>
            </nav>
            
        </div> 
        </div>
    );
};

export default Header;
